/* _______________  pre-loader function ________________ */
    $.fn.preLoadImages = function(callback) {
        var length = this.length;
        var iterator = 0;

        return this.each(function() {
            var self = this;
            var tmp = new Image();

            if (callback) tmp.onload = function() {
                callback.call(self, 100 * ++iterator / length, iterator === length);
            };

            tmp.src = this.src;
        });
    };

    $(window).load(function() {
         $('img').preLoadImages(function(perc, done) {
                console.log(this, perc, done);
                $('#preloader').fadeOut();
            });
        
   });

   
/* _______________  header_embellishements_adjust ________________ */
// whether to adjust the .header embellishments or hide the embellishments

function header_embellishements_adjust() {

    var $embellismentHeights = $('.header-embellishment-top').outerHeight() + $('.header-embellishment-bottom').outerHeight(),
        $lgHeight = $('.header .nav').outerHeight() + $('.header h3').outerHeight(),
        $mdHeight = $('.header .nav').outerHeight() + $('.header h3').outerHeight(),
        $smHeight = $('.header .menu-toggle').outerHeight() + $('.header h3').outerHeight(),
        $xsHeight = $('.header .menu-toggle').outerHeight() + $('.header h3').outerHeight(),
        $windowHeight = $('html').height(),
        $windowWidth = $(window).width();

    if (($windowHeight <= $xsHeight + $embellismentHeights) && ($windowWidth >= 0) && ($windowWidth < 600)) {
        $('.header').addClass('adjust-embellishments');
    } else
    if (($windowHeight <= $smHeight + $embellismentHeights) && ($windowWidth >= 600) && ($windowWidth < 900)) {
        $('.header').addClass('adjust-embellishments');
    } else
    if (($windowHeight <= $mdHeight + $embellismentHeights) && ($windowWidth >= 900) && ($windowWidth < 1200)) {
        $('.header').addClass('adjust-embellishments');
    } else 
    if (($windowHeight <= $lgHeight + $embellismentHeights) && ($windowWidth >= 1200)) {
        $('.header').addClass('adjust-embellishments');
    } else {
        $('.header').removeClass('adjust-embellishments');
    }
    
    if (($windowHeight <= $embellismentHeights)) {
        $('html').addClass('hide-embellishments');
    } else {
        $('html').removeClass('hide-embellishments');
    }

}
$(window).load(header_embellishements_adjust);
$(window).resize(_.debounce(header_embellishements_adjust, 200));



/* _______________  fitText________________ */
// initialize fitText and adjust when resizing using debounce
function fitTextVarious() {

    $('.the-couple-name').fitText(.8, {
        maxFontSize: '90px',
        minFontSize: '27px'
    });

    $('.the-couple-statement').fitText(2, {
        maxFontSize: '28px',
        minFontSize: '16px'
    });

    $('.the-couple-date').fitText(1, {
        maxFontSize: '50px',
        minFontSize: '18px'
    });
}
$(window).load(fitTextVarious);
$(window).resize(_.debounce(fitTextVarious, 200));


/* _______________  document ready for plugin initializations ________________ */
$(document).ready(function() {

    // ______ remove js on ready
    $('html').removeClass('no-js').addClass('js');

    // ______ menu toggle
    $('.menu-toggle').click(function(e) {
        $('html').toggleClass('menu-open');
        e.preventDefault();
    });

    // ______ clone menu
    $('.header .nav').clone(true).appendTo('.nav-wrapper-mobile-vertical-center');

    // ______ #document-top show on scroll
    $('#document-top').css('opacity', '0');

    $(window).scroll(function() {
        if ($(this).scrollTop() > 300) {
            $('#document-top').css('opacity', '1');
        } else {
            $('#document-top').css('opacity', '0');
        }
    });

    // ______  slide panel back to top
    $('a.scroll-panel-top').click(function(e) {
        $('.slide-panel').animate({
            scrollTop: 0
        }, 'slow');
        e.preventDefault();
    });

    $('.scroll-panel-top').css('opacity', '0');

    $('.slide-panel').scroll(function() {
        if ($(this).scrollTop() > 100) {
            $('.scroll-panel-top').css('opacity', '1');
        } else {
            $('.scroll-panel-top').css('opacity', '0');
        }
    });


    // ______ scrapbook look of images
    $(".img-treatment").prepend('<hr class="tl"><hr class="tr"><hr class="bl"><hr class="br">');


    // ______ data-slide function
    $('[data-slide="slide"]').click(function(e) {

        $('html').removeClass('theme-switcher-open'); // ------------ demo only 

        var $this = $(this);
        var target = $this.attr('data-target');
        var $target = $(target);
        if ($('.slide-panel-parent').children().is('.open')) {
            $('.open').not(target).removeClass('open');
            $('.active-slide-btn').not(this).removeClass('active-slide-btn');
            $(this).toggleClass('active-slide-btn');
            $(target).toggleClass('open');
            $('html').removeClass('slide-active');
        } else {
            $(target).toggleClass('open');
            $(this).toggleClass('active-slide-btn');
        }
        if ($('.slide-panel-parent').children().is('.open')) {
            $('html').addClass('slide-active');
        } else {
            $('html').removeClass('slide-active');
        }

        e.preventDefault();
    });

    $('.slide-panel .close').click(function(e) {
        $('.active-slide-btn').removeClass('active-slide-btn');
        $(this).parent().removeClass('open');
        $('html').removeClass('slide-active');
        $('.page-container').removeAttr('style');
        e.preventDefault();
    });


    // ______ prevent stray lines (widows)
    $('.love-block .h2').each(function() {
        var wordArray = $(this).text().split(" ");
        if (wordArray.length > 1) {
            wordArray[wordArray.length - 2] += "&nbsp;" + wordArray[wordArray.length - 1];
            wordArray.pop();
            $(this).html(wordArray.join(" "));
        }
    });

    // ______ adds fauxactive class on click for workaround for scrollspy when part of one "page" is showing -- used for last panel
    $('.nav-wrapper .nav').on('click', 'li', function() {
        $('.nav li').removeClass('fauxactive');
        $(this).addClass('fauxactive');
    });
    $(window).scroll(function() {
        $('.nav li').removeClass('fauxactive');
    });

    // ______ToolTips & PopOver Bootstrap's initializations
    if ($('html').hasClass('desktop')) {
        $('[data-hover="tooltip"]').tooltip({
            trigger: 'hover'
        });
        $('[data-hover="popover"]').popover({
            trigger: 'hover'
        });
    }

    $('[data-toggle="tooltip"]').tooltip({
        trigger: 'click'
    });
    $('[data-toggle="popover"]').popover({
        trigger: 'click'
    });

    $('body').on('mouseup', function(e) {
        $('[data-toggle="tooltip"]').each(function() {
            if (!$(this).is(e.target) && $(this).has(e.target).length === 0 && $('.tooltip').has(e.target).length === 0) {
                $(this).tooltip('hide');
            }
        });
    });

    $('body').on('mouseup', function(e) {
        $('[data-toggle="popover"]').each(function() {
            if (!$(this).is(e.target) && $(this).has(e.target).length === 0 && $('.popover').has(e.target).length === 0) {
                $(this).popover('hide');
            }
        });
    });

    // ______ single image with the class .pop-image on the href
    $('.pop-image').magnificPopup({
        type: 'image',
        closeMarkup: '<button title="%title%" class="mfp-close"><span class="ti ti-close"></span></button>',
        callbacks: {
            open: function() {
                addSwipeTo();
                $('html').css('margin-right', 0);
                $('html').css('overflow', 'visible');
            },
            close: function() {
                destroySwipe();
            }
        }
    });


    // hacky work around for custom close is bugged https://github.com/dimsemenov/Magnific-Popup/issues/535
    $(document).on('click', '.mfp-close', function(e) {
        e.preventDefault();
        $.magnificPopup.close();
    });


    // ______ gallery image with the class .pop-gallery on the wrapper and .pop-gallery-img on the href
    $('.pop-gallery').magnificPopup({
        delegate: '.pop-gallery-img', // child items selector, by clicking on it popup will open
        type: 'image',
        closeMarkup: '<button title="%title%" class="mfp-close"><span class="ti ti-close"></span></button>',
        gallery: {
            enabled: true
        },
        callbacks: {
            open: function() {
                addSwipeTo();
                $('html').css('margin-right', 0);
                $('html').css('overflow', 'visible');
            },
            close: function() {
                destroySwipe();
            }
        }
    });

    // ______ add swipe and destroy functions on the callbacks for magnificPopup
    var addSwipeTo = function(selector) {

        $('body').swipe("destroy");
        $("body").swipe({
            swipeLeft: function(event, direction, distance, duration, fingerCount) {
                $(".mfp-arrow-left").magnificPopup("prev");
            },
            swipeRight: function() {
                $(".mfp-arrow-right").magnificPopup("next");
            },
            threshold: 50
        });
    };

    var destroySwipe = function(selector) {
        $('body').swipe("destroy");
    };



    // ______ slide/scroll to menu target and close the menu if it's open on small devices
    $('.nav-wrapper .nav a').click(function(e) {
        if (location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '') && location.hostname == this.hostname) {
            var target = $(this.hash);
            target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
            if (target.length) {
                $('html').removeClass('menu-open'); // close the menu when the menu is clicked
                $('html,body').animate({
                    scrollTop: target.offset().top
                }, 1000);
            }
            e.preventDefault();
        }
    });

    // ______ slide/scroll to for .scroll and #document-top
    $('#document-top, .scroll').click(function(e) {
        if (location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '') && location.hostname == this.hostname) {
            var target = $(this.hash);
            target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
            if (target.length) {
                $('html,body').animate({
                    scrollTop: target.offset().top
                }, 1000);
            }
            e.preventDefault();
        }
    });



}); // end ready

  
/* _______________ make_page_height ________________ */
// make the sections min-height of the viewport 
function make_page_height() {

    var $page = $('.make-page-height'),
     $windowWidth = $(window).width(),
     $windowHeight = $('html').height();
   
       if (($windowWidth >= 1200)) {
            $page.css("min-height", $windowHeight + 'px');
        } else {
            $page.removeAttr('style');
        }
}
$(window).load(make_page_height);
$(window).resize(_.debounce(make_page_height, 500));



/* _______________ vertical_align_middle using FlexVerticalCenter________________ */
// vertical align middle all feature sections except the first (#begin) 
function vertical_align_middle() {
   $('.vertical-align-middle').flexVerticalCenter({ cssAttribute: 'padding-top', parentSelector: '.feature-section' });
}

$(window).resize(_.debounce(vertical_align_middle, 500));
$(document).ready(vertical_align_middle);


/* _______________ begin_vertical_align_middle ________________ */
//#begin section vertical align middle within the available space
function begin_vertical_align_middle() {

    $('.the-couple-content').wrapInner('<div class="v-middle-couple-outer"><div class="v-middle-couple-inner"></div></div>');

    var $page = $('.v-middle-couple-outer'),
        $content = $('.v-middle-couple-inner').innerHeight(),
        $masthead = $('.masthead-graphic').outerHeight(),
        $headerHeight = $('.header-top .header').height(),
        $windowWidth = $(window).width(),
        $totalHeight = $masthead + $headerHeight + $content,
        $totalLGSC = $masthead - $headerHeight + 150,
        $totalMDSC = $masthead - $headerHeight + 110,
        $window = $('html').height();

    if (($window >= $totalHeight) && ($windowWidth >= 1500)) {
        $page.css("height", $window - $totalLGSC + 'px');
        
    } else 
    if (($window >= $totalHeight) && ($windowWidth <= 1499)) {
        $page.css("height", $window - $totalMDSC + 'px');
        
    } else {
        $page.removeAttr('style');
    }

}
$(window).load(begin_vertical_align_middle);
$(window).resize(_.debounce(begin_vertical_align_middle, 500));


/* _______________  isotope/masonry initialization with imagesLoaded ________________ */
var $container = $('.simple-gallery').css('opacity', '0');

function istopeInit() {

    $container.imagesLoaded(function() {
        $container.css('opacity', '1').isotope({
            itemSelector: '.img-treatment',
            layoutMode: 'masonry',
            masonry: {
                columnWidth: '.grid-sizer',
                gutter: '.gutter-sizer'
            },
            resizesContainer: true
        });
    });

}

$(window).resize(_.debounce(istopeInit, 200)); // --------- demo only remove on live site
$(window).load(istopeInit); // --------- use document ready on live site


/* _______________ sorting for isotope/masonry ________________ */
$('.sort li a').on('click', function() {
    $('.sort li a').parent('li').removeClass('active');
    $(this).parent('li').addClass('active');
    var filterValue = $(this).attr('data-filter');
    
        if ($(window).width() <= 480) {
            var target = $container;
            if (target.length) {
                $('html,body').animate({
                    scrollTop: target.offset().top
                }, 1000);
            }
      }
    
    $container.isotope({
        filter: filterValue
    });
    return false;
}); 


/* _______________ detect IE all versions including edge && Kindle ________________ */

// detect IE and add html class "msie"
var IEversion = detectIE();

if (IEversion !== false) {
    document.documentElement.className += " msie"
}

/**
 * detect IE
 * returns version of IE or false, if browser is not Internet Explorer
 */
function detectIE() {
    var ua = window.navigator.userAgent;

    // test values
    // IE 10
    //ua = 'Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.2; Trident/6.0)';
    // IE 11
    //ua = 'Mozilla/5.0 (Windows NT 6.3; Trident/7.0; rv:11.0) like Gecko';
    // IE 12 / Spartan
    //ua = 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/39.0.2171.71 Safari/537.36 Edge/12.0';

    var msie = ua.indexOf('MSIE ');
    if (msie > 0) {
        // IE 10 or older => return version number
        return parseInt(ua.substring(msie + 5, ua.indexOf('.', msie)), 10);
    }
    var trident = ua.indexOf('Trident/');
    if (trident > 0) {
        // IE 11 => return version number
        var rv = ua.indexOf('rv:');
        return parseInt(ua.substring(rv + 3, ua.indexOf('.', rv)), 10);
    }
    var edge = ua.indexOf('Edge/');
    if (edge > 0) {
        // IE 12 => return version number
        return parseInt(ua.substring(edge + 5, ua.indexOf('.', edge)), 10);
    }
    // other browser
    return false;
}

// -- detect kindle
var ua = navigator.userAgent;
var isKindle = /Kindle/i.test(ua) || /Silk/i.test(ua) || /KFTT/i.test(ua) || /KFOT/i.test(ua) || /KFJWA/i.test(ua) || /KFJWI/i.test(ua) || /KFSOWI/i.test(ua) || /KFTHWA/i.test(ua) || /KFTHWI/i.test(ua) || /KFAPWA/i.test(ua) || /KFAPWI/i.test(ua);
if(isKindle) { 
 document.documentElement.className += " iskindle"
}


